import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Headers.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';

import logo from './img/zando-logo-small.png';

const Header = ({ wishlist, cart, user, setUser }) => {
    const [categories, setCategories] = useState([]);
    const location = useLocation(); // Track route changes

    // Fetch categories on component mount
    useEffect(() => {
        fetch('https://fakestoreapi.com/products/categories')
            .then((res) => res.json())
            .then((json) => {
                // Exclude specific categories
                const filteredCategories = json.filter(
                    (category) => category !== 'electronics' && category !== 'jewelery'
                );
                setCategories(filteredCategories);
            })
            .catch((error) => console.error('Error fetching categories:', error));
    }, []);

    // Logout handler
    const handleLogout = () => {
        setUser(null);
    };

    return (
        <nav className="navbar navbar-expand-lg bg-light sticky-top">
            <div className="container-fluid">
                {/* Logo */}
                <Link className="navbar-brand" to="/">
                    <img src={logo} alt="Logo" className="navbar-logo" />
                </Link>

                {/* Navbar Toggler */}
                <button
                    className="navbar-toggler"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#navbarNav"
                    aria-controls="navbarNav"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>

                {/* Navbar Links */}
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ms-auto">
                        {/* Collection */}
                        <li className="nav-item">
                            <Link className="nav-link" to="/product">
                                Collection
                            </Link>
                        </li>

                        {/* Shop Dropdown */}
                        <li className="nav-item dropdown">
                            <Link
                                className="nav-link dropdown-toggle"
                                id="shopDropdown"
                                role="button"
                                data-bs-toggle="dropdown"
                                aria-expanded="false"
                            >
                                Shop
                            </Link>
                            <ul className="dropdown-menu" aria-labelledby="shopDropdown">
                                {categories.map((category) => (
                                    <li key={category}>
                                        <Link className="dropdown-item" to={`/shop/${category}`}>
                                            {category.charAt(0).toUpperCase() + category.slice(1)}
                                        </Link>
                                    </li>
                                ))}
                            </ul>
                        </li>

                        {/* Wishlist */}
                        <li className="nav-item">
                            <Link className="nav-link" to="/wishlist">
                                <i className="fas fa-heart"></i>
                                {wishlist.length > 0 && (
                                    <span className="badge bg-danger ms-1">{wishlist.length}</span>
                                )}
                            </Link>
                        </li>

                        {/* Cart */}
                        <li className="nav-item">
                            <Link className="nav-link" to="/cart">
                                <i className="fas fa-shopping-cart"></i>
                                {cart.length > 0 && (
                                    <span className="badge bg-danger ms-1">{cart.length}</span>
                                )}
                            </Link>
                        </li>

                        {/* User Section */}
                        {user ? (
                            <>
                                <li className="nav-item">
                                    <span className="nav-link">Welcome, {user.username}</span>
                                </li>
                                <li className="nav-item">
                                    <button
                                        onClick={handleLogout}
                                        className="btn btn-link nav-link text-danger"
                                    >
                                        Logout
                                    </button>
                                </li>
                            </>
                        ) : (
                            <>
                                <li className="nav-item">
                                    <Link className="nav-link" to="/login">
                                        <i className="fas fa-user"></i> Login
                                    </Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="btn btn-outline-primary ms-2" to="/register">
                                        Register
                                    </Link>
                                </li>
                            </>
                        )}
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Header;
